        updateDepartment : async (data) => {
            const sql = `update department set dname = "${data.Dname}" where Dnumber = 1`; // where 조건, Dnumber가 1 인 경우 Dname 수정
            await promisePool.query(sql);       // department 테이블에 수정한 데이터 값을 전달하는 쿼리 실행
